import React from 'react';
import './comp1.css'

const Component1 = (props) => {
  const { changeId } = props;

  const changeComponent = () => {
    changeId();
  }
  return (
    <div className="component1">
      <h2>Create a project</h2>
      <br />
      <h3>Name</h3>
      <input className="input-box" />

      <h3>Type</h3>
      <select className="select-box">
        <option value="" disabled selected hidden>
          Select your role
        </option>
        <option value="#F00">Red</option>
        <option value="#0F0">Green</option>
        <option value="#00F">Blue</option>
      </select>

      <h3>Select Your role</h3>
      <select className="select-box">
        <option value="" disabled selected hidden>
          Select your role
        </option>
        <option value="#F00">BAP</option>
        <option value="#0F0">BPP</option>
        <option value="#00F">Beckn Gateway</option>
        <option value="#00F">Beckn Registry</option>
      </select>
        <button className="save-button" onClick={changeComponent()}>
          Save and Proceed
        </button>
    </div>
  );
};

export default Component1;
